import AddFolder from "components/AddFolder/AddFolder";
import FolderList from "components/FolderList/FolderList";
import CardList from "components/FolderPage/CardList/CardList";
import SearchInput from "components/FolderPage/SearchInput/SearchInput";

function Main({
  SelectedId,
  selectedName,
  links,
  onSelectedFolder,
  loadingError,
  search,
  folderListInfo,
  handleSearchChange,
}) {
  return (
    <>
      <FolderList
        onSelectedFolder={onSelectedFolder}
        SelectedId={SelectedId}
        folders={folderListInfo}
      />
      <AddFolder selectedName={selectedName} />
      <SearchInput
        loadingError={loadingError}
        search={search}
        handleSearchChange={handleSearchChange}
      />
      <CardList links={links} />
    </>
  );
}

export default Main;
